import React from "react";
import { FaUserAlt } from 'react-icons/fa';


class Login extends React.Component {
    render() {
        return(
            <div className="login">
                <h1>LOGIN</h1>
                <div>
                    <div>
                        <p>User Name</p>
                        <FaUserAlt/>
                        <input type="text" placeholder = ""/>
                    </div>
                </div>
            </div>
        );
    }



}

export default Login;
